import React from "react";
import "./card-style.css";

export const CardList = (props) => {
  return (
    <div className="card-list">
      {" "}
      {this.state.kediler.map((users) => (
        <h1 key={users.id}>{users.name}</h1>
      ))}{" "}
    </div>
  );
};
